import React from 'react';
import { CSSTransition } from 'react-transition-group';
import './VisualComponents.css';

export function Node(props) {
  return (
    <CSSTransition
      in={props.highlight}
      classNames="highlight"
      timeout={300}
      unmountOnExit
    >
      <span className="node">
        {props.children}
      </span>
    </CSSTransition>
  );
}
